import axious from "axios";

const api = axious.create({
  baseURL: "https://api.themoviedb.org/3/",
  params: {
    api_key: "6561c51fcc6645ae8ce767150472825f",
    language: "en-US",
  },
});

api.get("tv/popular");

export default api;
